function formatObject (object) {
  let query = ''
  for (var attribute of object) {
    query += attribute + '=' + object[attribute] + ','
  }
  query = query.slice(0, -1) // remove the last occurrence of character ','
  return query
}

function formatInsertValues (object) {
  let query = ''
  for (var attribute of object) {
    query += '"' + object[attribute] + '",'
  }
  query = query.slice(0, -1)
  return query
}

function formatArray (objects) {
  let query = ''
  for (let object of objects) {
    query = query.concat(object + ', ')
  }
  query = query.slice(0, -1) // remove the last occurrence of character ','
  return query
}

function formatSortObject (object) {
  let query = ''
  for (let attribute of object) {
    query += attribute + ' ' + object[attribute] + ','
  }
  query = query.slice(0, -1) // remove the last occurrence of character ','
  return query
}


export { formatObject, formatInsertValues }

function selectDb (type, dbNames, dbPaths, dirPath) {
  if (type === undefined ||
    dbNames === undefined) {
    return null
  } else if (typeof dbNames === 'string' && arguments.length <= 2) {
    dirPath = dbNames
    dbNames = DB_NAMES
    dbPaths = DB_PATHS
  } else if (typeof type !== 'string' ||
            !Array.isArray(dbNames) ||
            !Array.isArray(dbPaths) ||
            typeof dirPath !== 'string') {
    throw new TypeError('Not supported arguments in selectDb.')
  }

  let dbClass = null
  var index = 0
  for (var dbName of dbNames) {
    if (type === dbName) {
      try {
        dbClass = require(dirPath+dbPaths[index])
        break
      } catch (err) {
        throw err
      }
    }
    index += 1
  }

  return dbClass
}

const DB_NAMES = [
  'mysql',
  'sqlserver'
]

const DB_PATHS = [
  '/dbs/MySQL',
  '/dbs/SQLServer'
]

export { selectDb, DB_NAMES, DB_PATHS }

const MIN_TINYINT = 0
const MAX_TINYINT = 255
const MIN_SMALLINT = -32768
const MAX_SMALLINT = 32767
const MIN_INT = -2147483648
const MAX_INT = 2147483648
const MIN_BIGINT = -9223372036854775808
const MAX_BIGINT = 9223372036854775808

function outOfRange (number) {
  let query = ''

  if (number < MAX_TINYINT && number > MIN_TINYINT) {
    query = ' TINYINT '
  } else if (number < MAX_SMALLINT && number > MIN_SMALLINT) {
    query = ' SMALLINT '    
  } else if (number < MAX_INT && number > MIN_INT) {
    query = ' INT '
  } else {
    query = ' BIGINT '
  }

  return query
}

function STRING (length) {
  return ' VARCHAR(' + length + ') '
}

function DOUBLE () {
  return ' REAL '
}

function INT (number) {
  let query = outOfRange(number)
  return query
}

/**
  This file defines the types compatible to MySQL databases
